const AddNoteScreen = require("../../screenobjects/android/add-note.screen");

describe('Add Note Test', () => {
    it('Skip',async () => {
        await AddNoteScreen.skipBtn.click();

        await expect(AddNoteScreen.addNoteTxt).toBeDisplayed();
    });

    it('Add Note Test',async () => {
        await AddNoteScreen.addNoteTxt.click();
        await AddNoteScreen.txtType.click();
        await expect(AddNoteScreen.editingTxt).toBeDisplayed();

        await AddNoteScreen.headTxt.setValue("Fav Song List");

        await AddNoteScreen.dataTxt.addValue("asssdsfsdfsdfddff\ndsbkblsfd");

        await AddNoteScreen.saveNote();

        await expect(AddNoteScreen.editBtn).toBeDisplayed();
        await expect(AddNoteScreen.viewNoteData).toHaveText("asssdsfsdfsdfddff\ndsbkblsfd");
    });

});

